import React, { useEffect, useState } from 'react';
import Card from '../components/Card';
import Carousel from '../components/Carousel';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

export default function Home() {
  const [foodCat, setFoodCat] = useState([]); // Food categories
  const [foodItems, setFoodItems] = useState([]); // Food items
  const [search, setSearch] = useState(''); // Search term
  const [loading, setLoading] = useState(true); // Loading state

  const loadFoodItems = async () => {
    setLoading(true); // Set loading to true when fetching starts
    try {
      let response = await fetch("http://localhost:5000/api/foodData", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      let data = await response.json();
      console.log("API Response:", data);

      if (Array.isArray(data) && data.length === 2) {
        setFoodItems(data[0] || []);
        setFoodCat(data[1] || []);
      } else {
        console.error("Unexpected response format:", data);
      }
    } catch (error) {
      console.error("Error loading food items:", error);
    } finally {
      setLoading(false); // Set loading to false after fetching completes
    }
  };

  useEffect(() => {
    loadFoodItems();
  }, []);

  const handleSearchChange = (e) => {
    setSearch(e.target.value);
  };

  const filteredFoodItems = foodItems.filter(item =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div>
      <Navbar />
      <Carousel />
      <div className='container'>
        <div className='my-3'>
          {/* Search bar */}
          <form className="d-flex justify-content-center mb-3">
            <input 
              className="form-control me-2 w-75 bg-white text-dark" 
              type="search" 
              placeholder="Type in..." 
              aria-label="Search"
              value={search}
              onChange={handleSearchChange} // Update search state
            />
            <button className="btn text-white bg-success" type="button" onClick={(e) => e.preventDefault()}>Search</button>
          </form>
        </div>

        {loading ? (
          <div>Loading...</div> // Display loading state
        ) : foodCat.length > 0 ? (
          foodCat.map((data) => (
            <div className='row mb-3' key={data.id}>
              <div className='fs-3 m-3'>
                {data.CategoryName}
              </div>
              <hr id="hr-success" style={{ height: "4px", backgroundImage: "-webkit-linear-gradient(left,rgb(0, 255, 137),rgb(0, 0, 0))" }} />
              {filteredFoodItems.length > 0 ? filteredFoodItems
                .filter(item => item.CategoryName === data.CategoryName)
                .map(filteredItem => (
                  <div key={filteredItem.id} className='col-12 col-md-6 col-lg-3'>
                    <Card 
                      foodName={filteredItem.name} 
                      item={filteredItem} 
                      options={filteredItem.options[0]} 
                      ImgSrc={filteredItem.img} 
                    />
                  </div>
                )) 
                : <div>No Such Data</div>}
            </div>
          ))
        ) : (
          <div>No Categories Available</div>
        )}
      </div>
      <Footer />
    </div>
  );
}
